import "AppExpenses.css"
import "ExpenseItem.css"
import ExpenseItem from "./ExpenseItem";

function AppExpenses(props) {
    return(
        <div className = "expenses"> 
        <ExpenseItem title= {props.expenses[0].title} amount= {expenses[0].amount} date = {expenses[0].date}></ExpenseItem>
      <ExpenseItem title= {props.expenses[1].title} amount= {expenses[1].amount} date = {expenses[1].date}></ExpenseItem>
      <ExpenseItem title= {props.expenses[2].title} amount= {expenses[2].amount} date = {expenses[2].date}></ExpenseItem>
      <ExpenseItem title= {props.expenses[3].title} amount= {expenses[3].amount} date = {expenses[3].date}></ExpenseItem>
      </div>
    )
}
export default AppExpenses
